import React from 'react'
import {
    Card,
    CardContent,
    Chip,
    Container,
    Dialog,
    DialogContent,
    DialogTitle,
    Typography,
    Button,
} from '@mui/material';

export default function ApptDialog({ selectedStartTimes, dialogOpen, handleCloseDialog, selectedDate, selectedStartTime, setSelectedStartTime, handleBooking }) {
    return (
        <div>
            <Dialog open={dialogOpen} onClose={handleCloseDialog}>
                <DialogTitle>Selected Date: {selectedDate}</DialogTitle>
                <DialogContent>
                    <Typography variant="body2">Available Start Times:</Typography>
                    {selectedStartTimes.map((startTime, index) => (
                        <Chip
                            key={index}
                            label={startTime}
                            variant="outlined"
                            color="primary"
                            className="mt-2"
                            onClick={() => setSelectedStartTime(startTime)}
                        />
                    ))}
                    {selectedStartTime && (
                        <Button
                            variant="contained"
                            color="primary"
                            onClick={() => handleBooking(selectedStartTime)}
                        >
                            Book Appointment
                        </Button>
                    )}
                </DialogContent>
            </Dialog>
        </div>
    )
}
